/**
 * @param {string} s
 * @return {number}
 */
var minimumBeautifulSubstrings = function(s) {
    const isBeautiful = (binary) => {
        let num = parseInt(binary, 2);
        while (num > 0 && num % 5 === 0) num /= 5;
        return num === 1;
    };

    const dp = new Array(s.length + 1).fill(Infinity);
    dp[0] = 0;

    for (let i = 1; i <= s.length; i++) {
        if (s[i-1] === '0') continue;
        for (let j = 0; j < i; j++) {
            if (isBeautiful(s.substring(j, i))) {
                dp[i] = Math.min(dp[i], dp[j] + 1);
            }
        }
    }

    return dp[s.length] === Infinity ? -1 : dp[s.length];
};
